import React, { useState, useEffect } from 'react';

const Die = (props) => {
  const styles = {
    backgroundColor: props.clicked ? '#59E391' : '#ffffff',
  };

  return (
    <div className='die'>
      <h2 className='die-num'>{props.value}</h2>
    </div>
  );
};

export default Die;
